import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Footer() {
    return(
        <footer className="sticky-foote my-font">
            <Container fluid={true}>
                <ul>
                    <li><a href="mailto:bryanjg2@illinois.edu">Email</a></li>
                    <li><a href="https://linkedin.com/in/bryange" target="_blank" rel="noreferrer" >LinkedIn</a></li>
                </ul>
            </Container>
        </footer>
    )
}

export default Footer;
